import Filter from './filter'

export {List, Filter} */

const Component = {
    Filter : () =>{
        return(
            <div className="filter">
                <div className="d-flex align-items-center my-3 me-3">
                    <small className="active bg-purple rounded-pill fw-bold me-4" aria-current="page">All</small>
                    <small className="text-black fw-bold mx-4">Important</small>
                    <small className="text-black fw-bold mx-4">Unread</small>
                    <small className="text-black fw-bold ms-4">Read</small>
                </div>
            </div>
        )
    },
    Menu : () =>{
        return(
            <div id="menu" className="flex-grow-1 me-5">
                <div className="d-flex justify-content-between mb-2 p-3 bg-purple rounded-pill">
                    <a href="#news"><img src="style/images/add.svg" className="img-fluid" alt="..." /></a>
                    <a href="#news"><img src="style/images/Lock.svg" className="img-fluid" alt="..." /></a>
                    <a href="#news"><img src="style/images/channel.svg" className="img-fluid" alt="..." /></a>
                </div>
            </div>
        )
    }
}
